import React, { Component } from "react";
import PageTemplate from "./PageTemplate";
import TodoInput from "./TodoInput";

class App extends Component {
	state = {
		input : ""
	}
	render(){
		return (
			<div>
				<PageTemplate>
					<TodoInput/>
				</PageTemplate>
			</div>
		)
	}
}

export default App;
